Region.render = function(options) {
	this.opts = $.extend({
		prov_id: 0,
		city_id: 0,
		area_id: 0,
		prov_name: 'prov_id',
		city_name: 'city_id',
		town_name: 'area_id',
		ele: '.region-container',
		readonly: false,
		town_enabled: true
	}, options)
	this.$ele = $(this.opts.ele)
	this.provJson = {};
	this.$provInline = $('<div class="layui-input-inline  prov-input-inline"></div>')
	this.$prov = $('<select lay-filter="prov_id" name="' + this.opts.prov_name + '" lay-search=""></select>')
	this.$cityInline = $('<div class="layui-input-inline city-input-inline" style="display:none"></div>')
	this.$city = $('<select lay-filter="city_id" name="' + this.opts.city_name + '" lay-search=""></select>')
	this.$townInline = $('<div class="layui-input-inline  town-input-inline" style="display:none"></div>')
	this.$town = $('<select lay-filter="area_id" name="' + this.opts.town_name + '" lay-search=""></select>')
	this.$ele.append(this.$provInline)
	this.$ele.append(this.$cityInline)
	this.$ele.append(this.$townInline)
	this.$provInline.append(this.$prov)
	this.$cityInline.append(this.$city)
	this.$townInline.append(this.$town)
	if (this.opts.readonly == true) {
		this.$prov.prop('disabled', true);
		this.$city.prop('disabled', true);
		this.$town.prop('disabled', true);
	}
	if (this.opts.town_enabled == false) {
		this.$townInline.css({
			visibility: 'hidden',
			position: 'absolute'
		})
	}

	var that = this;
	layui.use(['form'], function() {
		that.form = layui.form;
		that.provJson = that.buildTreeJson(JSON.parse(Region.json))
		that.renderProv();
	})
}
Region.buildTreeJson = function(data) {
	var data_temp = {};
	for (var i in data) {
		data_temp[data[i].region_id] = data[i];
		data_temp[data[i].region_id]['children'] = this.buildTreeJson(data[i].children)
	}
	return data_temp;
}
Region.renderProv = function() {
	var options = '<option value="">...</option>';

	for (var index in this.provJson) {
		if (parseInt(this.opts.prov_id) == parseInt(this.provJson[index].region_id)) {
			options += '<option value="' + this.provJson[index].region_id + '" selected>' + this.provJson[index].name + '</option>'
		} else {
			options += '<option value="' + this.provJson[index].region_id + '">' + this.provJson[index].name + '</option>'
		}
	}
	this.$prov.html(options);
	if (parseInt(this.opts.prov_id) == 0) {
		this.form.render('select')
	}
	this.form.render('select')
	var that = this;
	this.form.on('select(prov_id)', function(data) {
		that.opts.prov_id = data.value;
		that.opts.city_id = 0;
		that.opts.area_id = 0;
		that.renderCity();
	})
	this.form.on('select(city_id)', function(data) {
		that.opts.city_id = data.value;
		that.renderTown();
	})
	this.form.on('select(area_id)', function(data) {
		that.opts.area_id = data.value;
	})
	this.renderCity();
}
Region.renderCity = function() {
	this.$city.html('')
	this.$cityInline.hide();
	if (parseInt(this.opts.prov_id) > 0) {
		var city_data = this.provJson[this.opts.prov_id]['children'];
		var options = '<option value="">...</option>';
		for (var index in city_data) {
			if (parseInt(this.opts.city_id) == parseInt(city_data[index].region_id)) {
				options += '<option value="' + city_data[index].region_id + '" selected>' + city_data[index].name + '</option>'
			} else {
				options += '<option value="' + city_data[index].region_id + '">' + city_data[index].name + '</option>'
			}
		}
		if (!!options) {
			this.$cityInline.show();
			this.$city.html(options);
			this.form.render('select')
		}
	}
	this.renderTown();
}
Region.renderTown = function() {
	this.$town.html('')
	this.$townInline.hide();
	if (parseInt(this.opts.city_id) > 0) {
		var town_data = this.provJson[this.opts.prov_id]['children'][this.opts.city_id]['children'];
		var options = '<option value="">...</option>';
		for (var index in town_data) {
			if (this.opts.area_id == town_data[index].region_id) {
				options += '<option value="' + town_data[index].region_id + '" selected>' + town_data[index].name + '</option>'
			} else {
				options += '<option value="' + town_data[index].region_id + '">' + town_data[index].name + '</option>'
			}
		}
		if (!!options) {
			this.$townInline.show();
			this.$town.html(options);
			this.form.render('select')
		}
	}
}